//🌈段评相关
function dpcl(dprr, res, tpdp) {
	let java = this.java;
	dprr = com.jayway.jsonpath.JsonPath.parse(dprr);
	let dp = dprr.read('$.data.list[*]');
    let [tc, ac]=this.color();
	for (let char of dp) {
		let id = char.paragraphId;
		let count = char.textCount;
		if (count > 999) count = 999;
		let hot = +char.isHotComment;
        let color = hot == 1? ac : tc;
		if (id == -10) {
            java.put('zjsdp',count);
            this.chapter.putLyric("");}
		else if (id == -1) {
            this.chapter.putImgUrl(`http:${count+id},{"js":"dpurl(${count},'${color}')","click":"dpshow(${id})","type":"i",style:"text"}`);
		} else if (id > 0) {
            let svgstr = `<img src="http:${count+id},{"style":"TEXT","js":"dpurl(${count},'${color}')","click":"dpshow(${id})","type":"i"}">`;
            if (id > 99999) {
                let intt = tpdp[id];
                if (intt != null) {
                    res[intt] = res[intt].replace('>','>'+svgstr);
                }
            }
            else {res[id - 1] += svgstr;}
		}
	}
	return res;
}

function dpshow(id) {
    let [, zcid] = this.chapter.url.match(/^[^\,]+,([^\,]+)/);
	zcid = this.java.base64Decode(zcid);
	this.ifjs(zcid,this.book.getVariable("bkid"),id)
}

function dpurl(count, color) {
	return `data:image/svg+xml;base64,${this.java.base64Encode(dpt(count, color))}`;	
}



