function dbkid(x) {
    const {java, source, book} = this;
    try {
        if (!book) throw '请在书籍界面点击';
        var bkid = book.getVariable("bkid");
        var bj = book.getVariable("bj");
        if (bkid.length() < 3) throw '未正常获取id';
        if (x == 0) {
            if (this.isLongClick) {
             java.copyText(bkid);
            java.toast('已复制《' + book.name + '》id号');
            return
            }
            java.copyText(book.name);
            java.toast('已复制书名《' + book.name + '》');
            return
        }
        if (x == 1)
            java.openUrl('qdreader://app/showBook?query={"bookId":' + bkid + '}');
        else if (x == 2&&bj !='评')
            this.rqjs(bkid);
        else if (x == 3) {
            if (bj =='评') {
                java.toast('应该是误触吧？\n没必要点击这里');
                return 1;
            }
            let au = (book.author+'').replace('\u200b', '');
            source.put("qdzskzz",au);
            java.open("explore",'{{`data:page;base64,${java.base64Encode("作,"+page)},{"type":"lyc"}` }}',au);
        } else if (x == 4) {
            if ( bj == '评') {
                 source.put("qdzsdsp",bkid);
                java.open("explore",'{{`data:page;base64,${java.base64Encode("单,"+page)},{"type":"lyc"}` }}',book.name);
                Packages.java.lang.Thread.sleep(100);
                java.toast('\n已经是评论了，为你加载该书单');
                return
            }
            source.put("qdzsdsp",bkid);
            java.open("explore",'{{`data:page;base64,${java.base64Encode("评,"+page)},{"type":"lyc"}` }}',book.name);
        }
        else if (x == 5) {
            java.copyText(`《${book.name}》作者：${book.author.replace('\u200b', '')}
链接：https://m.qidian.com/book/${bkid}/`);
            java.longToast('已复制到剪贴板');
        }
        else if (x == 6) {
            if ( bj == '评') {
                source.put("qdzsdsp",bkid);
                java.open("explore",'{{`data:page;base64,${java.base64Encode("单,"+page)},{"type":"lyc"}` }}',book.name);
                return 1
            }
            return 0
        }
    } catch (err) {
        java.toast(err);
        return 0
    }
}



//🌈辅助类函数
function connectb(url) { //网络访问
return Packages.io.legado.app.model.analyzeRule.AnalyzeUrl(url).getByteArray();
}

function color(gbg=false) { //得到阅读配色
    let java = this.java;
    let md = java.getThemeMode();
    let rdc = java.getReadBookConfigMap();
    if (md == 3) {
         let tc = rdc["textColorEInk"].slice(-6);
        let ac = rdc["textAccentColorEInk"].slice(-6);
        if (gbg) {
            let bg = rdc["bgStrEInk"];
            return [tc, ac, secondColor(bg)];
        }
        return [tc, ac];
    }
    if (md == 0) {
        let isN=java.getThemeConfigMap()["isNightTheme"];
        md = isN==true?2:1;
    }
    if (md == 1) {
         let tc = rdc["textColor"].slice(-6);
        let ac = rdc["textAccentColor"].slice(-6);
        if (gbg) {
            let bg = rdc["bgStr"];
            return [tc, ac, secondColor(bg)];
        }
        return [tc, ac];
    }
    if (md == 2) {
         let tc = rdc["textColorNight"].slice(-6);
        let ac = rdc["textAccentColorNight"].slice(-6);
        if (gbg) {
            let bg = rdc["bgStrNight"];
            return [tc, ac, secondColor(bg)];
        }
        return [tc, ac];
    }
}

function tcolor() { //得到主题配色
    let tc = this.java.getThemeConfigMap();
    let isN=tc["isNightTheme"];
    let cf = isN==true? "EFEFEF":"101010";
    let ac = tc["accentColor"].slice(-6);
    let bg= tc["backgroundColor"].slice(-6);
    let pr=tc["primaryColor"].slice(-6);
    return [cf, ac,bg,pr];
}

function darkenColor(hex, amount = 100) {
  const bigint = parseInt(hex, 16);
  let r = (bigint >> 16) & 255;
  let g = (bigint >> 8) & 255;
  let b = bigint & 255;
  r = Math.max(0, r - amount);
  g = Math.max(0, g - amount);
  b = Math.max(0, b - amount);
  return ((r << 16) + (g << 8) + b).toString(16).padStart(6, '0');
}

function secondColor(hex,fi,ment = 40) { //第二颜色，亮色暗，暗色亮
    if (!fi&&!hex.startsWith('#')) return null;
    const r = parseInt(hex.slice(-6,-4), 16);
    const g = parseInt(hex.slice(-4,-2), 16);
    const b = parseInt(hex.slice(-2), 16);
    const brightness = (r * 299 + g * 587 + b * 114) / 1000;
    let nr, ng, nb;
    if (brightness > 128) {
        nr = Math.max(0, r - ment);
        ng = Math.max(0, g - ment);
        nb = Math.max(0, b - ment);
    } else {
        nr = Math.min(255, r + ment);
        ng = Math.min(255, g + ment);
        nb = Math.min(255, b + ment);
    }
    return ((1 << 24) + (nr << 16) + (ng << 8) + nb).toString(16).slice(1);
}

function gethd(url,ck='',ua='') {
let u_am=this.java.getWebViewUA().replaceAll("; wv| Version\/4.0",'');
let domain=(url+'').match(/^http.{4}[^\/]+./)[0];
	let headerss = {
		  "User-Agent": u_am,
		  "sec-ch-ua": s_c_ua,
    	 "sec-ch-ua-mobile": s_c_ua_m,
     	"sec-ch-ua-platform": s_c_ua_p,
     	"Cache-Control": cache_c,
     	"Accept-Language": a_l,
     	"Sec-Fetch-Site": "none",
     	"Sec-Fetch-Mode": "navigate",
     	"Sec-Fetch-Dest": "document",
     	"Referer": domain
    	 }
if (/\.js$/.test(url)) {headerss["Sec-Fetch-Dest"]="script";}
else if (/\.(?:png|jpe?g|webp|gif)$/i.test(url)) {headerss["Sec-Fetch-Dest"]="image";
headerss["Sec-Fetch-Site"]="same-origin";
headerss["Sec-Fetch-Site"]="no-cors";}
if (/www.libahao/.test(url)) {
headerss["User-Agent"]=u_ap;
headerss["sec-ch-ua-mobile"]=s_c_ua_mp;
headerss["sec-ch-ua-platform"]=s_c_ua_pp;
}
if (ck=='1') return url + ',' + JSON.stringify({"headers":headerss,"webView":true});
if (ck!='') headerss["Cookie"]=ck;
if (ua!='') headerss["User-Agent"]=ua;
return url + ',' + JSON.stringify({"headers":headerss});
};

